import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

function Header() {
  return (
    <header className="header">
      <div className="header-container">
        <img src={require('../assets/logo.png')} alt="Aloha Turismo" className="logo-img" />
        <nav className="nav-menu">
          <Link to="/" className="nav-link">Início</Link>
          <Link to="/aluguel-onibus" className="nav-link">Aluguel de Ônibus</Link>
          <Link to="/turismo" className="nav-link">Turismo</Link>
          <Link to="/nossa-frota" className="nav-link">Nossa Frota</Link>
          <Link to="/contato" className="nav-link">Contato</Link>
        </nav>
      </div>
    </header>
  );
}

export default Header;
